import React from 'react';

type ButtonType = {
    onClick: (start: number) => void
    title: string
}


const Button = (
    {
        onClick,
        title,
    }: ButtonType) => {



    return (
        <div>
            <button onClick={()=> onClick}>{title}</button>
        </div>
    );
};

export default Button;
